import React from 'react';
import './WinDisplayStyles.scss'







const WinDisplay = ({lightOne, lightTwo}) => {

    const light1 = lightOne;
    const light2 = lightTwo;



    return (
        <div className="display-container">

            <div className='winner-bulb'>
                <div className='light' style={{display: `${light1}` }}></div>
            </div>
            <div className='winner-bulb'>
                <div className='light' style={{display: `${light2}` }}></div>
            </div>
        </div>
    );

}

export default WinDisplay
